import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import feiyanChinaData from './china_feiyan_data.json'



feiyanChinaData.data.forEach((item, key)=>{
    console.log(item);

    let feiyanChinaitem =  {
      name: "",
      confirm: 0,
      cure: 0,
      dead: 0,
      exist: 0,
    }  

    feiyanChinaitem.name = item.name;

    item.trend.list.forEach((ittem_trend, key_trend)=>{
        console.log(ittem_trend);
    });

});
